pragma solidity ^0.6.0;

import "@openzeppelin/contracts/math/SafeMath.sol";

/**
 * @dev Token for tracechain based on ERC1155.
 */
contract T1155 {
    using SafeMath for uint256;

    // tokenId => (owner => balance).
    mapping(uint256 => mapping(address => uint256)) internal balances;

    // tokenId => (owner => eventId).
    mapping(uint256 => mapping(address => uint256)) internal origins;

    // tokenId => creators id of token to its creator
    mapping(uint256 => address) public idToCreator;

    // owner => (operator => approved)
    mapping(address => mapping(address => bool)) internal operatorApproval;

    // tokenId => uri id of a token to its metadata uri(unused for now).
    mapping(uint256 => string) internal idToUri;

    // A nonce to ensure a unique id for each mint.
    uint256 public tokenNonce;

    // A nonce to ensure a unique id for each event.
    uint256 internal eventNonce;

    modifier creatorOnly(uint256 _tokenId) {
        require(idToCreator[_tokenId] == msg.sender, "Creator only");
        _;
    }

    modifier canOperate(address _from, address _to) {
        require(_to != address(0x0), "Address must be non-zero.");
        require(
            _from == msg.sender || operatorApproval[_from][msg.sender] == true,
            "Need operator approval for 3rd party transfers."
        );
        _;
    }

    /**
    @dev Emits when tokens are transferred, including zero value transfers as well as minting or burning.
    @param _id id of the event.
    @param _from address of the holder whose balance is decreased.
    @param _to address of the recipient whose balance is increased.
    @param _tokenId token type being transferred.
    @param _value number of tokens the holder balance is decreased by and match what the recipient balance is increased by.
    @param _parentId id of the parent event.
    When minting tokens, the `_from` argument MUST be set to `0x0` (i.e. zero address).
    When burning tokens, the `_to` argument MUST be set to `0x0` (i.e. zero address).
    When minting tokens, the `_parentId` argument MUST be set to `0`.
  */
    event Transfer(
        uint256 indexed _id,
        address _from,
        address _to,
        uint256 _tokenId,
        uint256 _value,
        uint256 _parentId
    );

    /**
    @dev Emits when approval for a second party/operator address to manage all tokens for an owner address is enabled or disabled (absence of an event assumes disabled).
  */
    event ApprovalForAll(
        address indexed _owner,
        address indexed _operator,
        bool _approved
    );

    /**
    @dev Transfers `_value` amount of an `_tokenId` from the `_from` address to the `_to` address specified.
    @param _from address of the holder whose balance is decreased.
    @param _to address of the recipient whose balance is increased.
    @param _tokenId token type being transferred.
    @param _value number of tokens the holder balance is decreased by and match what the recipient balance is increased by.
  */
    function transfer(
        address _from,
        address _to,
        uint256 _tokenId,
        uint256 _value
    ) external canOperate(_from, _to) {
        _transfer(_from, _to, _tokenId, _value);
    }

    /**
    @dev Actually performs the transfer.
  */
    function _transfer(
        address _from,
        address _to,
        uint256 _tokenId,
        uint256 _value
    ) internal {
        balances[_tokenId][_from] = balances[_tokenId][_from].sub(_value);
        balances[_tokenId][_to] = _value.add(balances[_tokenId][_to]);

        origins[_tokenId][_to] = ++eventNonce;
        emit Transfer(
            eventNonce,
            _from,
            _to,
            _tokenId,
            _value,
            origins[_tokenId][_from]
        );
    }

    /**
    @dev Get the balance of an account's Tokens.
    @param _owner address of the token holder
    @param _id id of the token
    @return owner's balance of the Token type requested
  */
    function balanceOf(address _owner, uint256 _id)
        external
        view
        returns (uint256)
    {
        return balances[_id][_owner];
    }

    /**
    @dev Get the balance of multiple account/token pairs
    @param _owners addresses of the token holders
    @param _ids ids of the Tokens
    @return owner's balance of the Token types requested (i.e. balance for each (owner, id) pair)
  */
    function balanceOfBatch(address[] calldata _owners, uint256[] calldata _ids)
        external
        view
        returns (uint256[] memory)
    {
        require(_owners.length == _ids.length, "Array lenght must match.");

        uint256[] memory balances_ = new uint256[](_owners.length);

        for (uint256 i = 0; i < _owners.length; ++i) {
            balances_[i] = balances[_ids[i]][_owners[i]];
        }

        return balances_;
    }

    /**
    @dev Enable or disable approval for a third party ("operator") to manage all of the caller's tokens.
    @param _operator address to add to the set of authorized operators.
    @param _approved true if the operator is approved, false to revoke approval.
  */
    function setApprovalForAll(address _operator, bool _approved) external {
        operatorApproval[msg.sender][_operator] = _approved;
        emit ApprovalForAll(msg.sender, _operator, _approved);
    }

    /**
    @dev Queries the approval status of an operator for a given owner.
    @param _owner owner of the tokens.
    @param _operator address of authorized operator.
    @return true if the operator is approved, false to revoke approval.
  */
    function isApprovedForAll(address _owner, address _operator)
        external
        view
        returns (bool)
    {
        return operatorApproval[_owner][_operator];
    }

    /**
    @dev Mints an `_initialSupply` amount(s) of a new token to the minter (msg.sender for now).
    @param _initialSupply number of token the minter balance is increased by.
  */
    function mint(uint256 _initialSupply) external {
        uint256 tokenId = ++tokenNonce;
        idToCreator[tokenId] = msg.sender;
        balances[tokenId][msg.sender] = _initialSupply;

        emit Transfer(
            ++eventNonce,
            address(0x0),
            msg.sender,
            tokenId,
            _initialSupply,
            0
        );
        origins[tokenId][msg.sender] = eventNonce;
    }

    /**
    @dev Burns a `_value` amount(s) of `_id` from the `_from` address.
    @param _from address of the owner.
    @param _tokenId id of the token.
    @param _value amount to be burnt.
  */
    function burn(
        address _from,
        uint256 _tokenId,
        uint256 _value
    ) external canOperate(_from, _from) {
        balances[_tokenId][_from] = balances[_tokenId][_from].sub(_value);

        emit Transfer(
            ++eventNonce,
            _from,
            address(0x0),
            _tokenId,
            _value,
            origins[_tokenId][_from]
        );
        origins[_tokenId][_from] = eventNonce;
    }
}

